import { useLinking } from "@react-navigation/native";
import { Linking } from "expo";

export default function (containerRef) {
  return useLinking(containerRef, {
    prefixes: [Linking.makeUrl("/")],
    config: {
      Root: {
        path: "root",
        screens: {
          Main: {
            path: "/main",
            screens: {
              People: {
                path: "/people",
                screens: {
                  Read: "annuaire/person",
                  List: "annuaire",
                },
              },
            },
          },
          Jobs: "links",
          Settings: "settings",
        },
      },
      Auth: {
        path: "auth",
        screens: {
          SignUp: "/signup",
          LogIn: "login",
        },
      },
    },
  });
}
